    render(){
        return (
            <div>
                <form onSubmit= {this.handleSubmit}>
                <input 
                type="text"
                placeholder="Type user..."
                onChange={e=> this.setState({username:e.target.value})} />
                </form>


                </div>
        )
    }
}
